webpackJsonp([0xafa513ef9376],{6868:function(e,t){e.exports={data:{post:{html:'<p>I\'ve been preoccupied this weekend by my wife\'s birthday celebration, work matters, hay fever, and Euro 2004, but I would be remiss not to mention <a href="http://wiki.blogg.de/BlogGrill">BlogGrill in Hamburg</a> last Thursday. I was there. I did man the grill for a time (after expressing doubt about the grilling skill of urban Germans and the equipment used). I did not introduce myself around, and thus missed half the people who were there. Next time we need name tags, maybe stickers that say "Hi, my URL is....".</p>\n<p>The main impression I gained is that an amazing number of north German bloggers once worked for McDonald\'s.</p>',fields:{title:"Grill It (Like A Polaroid Picture)",date:"14 Jun 2004",url:"https://papascott.de/2004-06-14-grill-it-like-a-polaroid-picture/"}}},pathContext:{slug:"/2004-06-14-grill-it-like-a-polaroid-picture/",prev:{fields:{title:"Zidane is God!",date:"13 Jun 2004",slug:"/2004-06-13-zidane-is-god/"}},next:{fields:{title:"Pardon Me?",date:"15 Jun 2004",slug:"/2004-06-15-pardon-me/"}}}}}});
